import React,{useEffect} from 'react'
import { connect } from 'react-redux';
import axios from 'axios'
import store from '../../Controllers/Store/store'
import * as actions from '../../Controllers/Actions/Actions'
import TopNav from './TopNav'

function Home(){
    const name = [];
    useEffect(() => {
        document.title = "Home | Friend Finder";
        axios.post('http://localhost:4000/check-login',[localStorage.getItem('key')])
        .then(res=>{
            store.dispatch(actions.addUserName(res.data))
            try{
                name.push(store.getState().setName[0].name)
            }
            catch(err){
                console.log(err.message);
                name.push("loading..")
            }
        })
        .catch(err=>{
            alert(err)
        })
    }, [])

    return(
        <div className="home">
            <TopNav name={name[0]} />
            <div className="main-content">
                <div className="home-people-you-may-know">
                    <p>People you may know</p>
                </div>
            </div>
        </div>
    )
}

export default connect(
    null,
    { actions }
)(Home);
